 100

transfer tx: a1ba017b3974b98bf9c8edc824c3abc0ce17678a14e7cfac94b5900a290bdd07
✔ confirm transfer
Note that we MUST specify the senderAddress using base58 address format. We'll fix this in the future. See: qtumjs issues#2We can then verify that 9d74...9cc6 had indeed received the tokens:node index.js balance 9d748f98e65c6875dbed7bfb6ffbeca426ff9cc6

balance: 100
And that the origin account's balance decremented by 100:node index.js balance dcd32b87270aeb980333213da2549c9907e09e94

balance: 23600
Observing Contract EventsThe CappedToken contract defines a few events. The Transfer event is emitted whenever fund is moved from one account to another (also when minting new tokens). The Transfer event:event Transfer(
  address indexed from,
  address indexed to,
  uint256 value
);
Let's use qtumjs to subscribe to the stream of contract events, so we can react in a timely manner when a transfer occurs. The code:async function streamEvents() {
  console.log("Subscribed to contract events")
  console.log("Ctrl-C to terminate events subscription")

  myToken.onLog((entry) => {
    console.log(entry)
  }, { minconf: 1 })
}
Let's see it in action. Launch the events subscriber:node index.js events

Subscribed to contract events
Ctrl-C to terminate events subscription
The program hangs there waiting for new events. In another terminal, mint more tokens:node index.js mint dcd32b87270aeb980333213da2549c9907e09e94 10000

mint tx: c0e3007178a1b9e05b33e770f7a0e7d084f2d06732658524be042dc0e9864cc4
Wait for a bit for confirmations. In the events terminal, you should see both Mint and Transfer events printed out:{ blockHash: 'd8135a1a0e4cddb82a6912fc7eb2bd7f717b7e85069dc2fa3b8f0f8c02acbd17',
